import styles from './Contact.module.css'
import { Link } from 'react-router-dom';  

const Contact = () => {
    return (
        <nav className={styles.nav}>
        <ul>

            <li>
              <Link to='/Contacto'></Link>
            </li>

        </ul>
      </nav>
    );
};

export default Contact;
